import React, { Component } from 'react';
import './App.css';
import Dashboard from './compopnents/Dashboard';
import axios from 'axios';

class Main extends Component{

    state = {

    }

    addDays = (date, days) => {
        var result = new Date();
        result.setDate(date.getDate() + days);
        return Math.round(result.getTime()/1000);
    }

    componentDidMount () {
        const ICAO = ["KDFW","KIAH","KJFK","KATL","KSFO","KLAX","KORD","KDEN","KLAS","KSEA"];
        const startDate = this.addDays(new Date(),-1);
        const endDate = this.addDays(new Date(),0);
        console.log(ICAO[0]);
        console.log(startDate);
        console.log(endDate);
        const url = 'https://opensky-network.org/api/flights/arrival?airport='+ICAO[0]+'&begin='+startDate+'&end='+endDate+'';
        console.log(url);
        axios.get(url)
                .then(response => {
                    console.log(response);
                });

    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <Dashboard/>
                </header>
            </div>
        );
      }

}

export default Main;
